    "julia-butler-hansen-nwr-initial-survey-instructions-for-grazed-pasture-monitoring-protocol",nt"isopen":
    false,nt"url": null,nt"notes": "Grazing is used as a tool to control reed
    canary grass (RCG) on the refuge.  RCG is an invasive grass that has covered about
    70 of the JBH Mainland and Tenasillahe Island and has out competed nearly all other
    species on the wet open areas of the Refuge.  This grass holds little value for
    Columbian White-tailed deer and other wildlife species on the Refuge.  Grazing grasses
    to a lower level allows more light to the ground surface and allows some forb growth.
     In addition, it forces resprouting, which creates more nutritious forage.  Pastures
    can be overgrazed however, and it is important to move cattle to other fields when
    resources become low.  Reducing RCG can also encourage the growth of other invasives,
    such as tussock and tansy ragwort.  In addition, it is important to monitor forb
    growth to determine whether grazing is affecting forb availability.",nt"license_title":
